data = '''



'''

dim=3
lines = data.split("\n")
keypad = [[None]*dim for _ in range(dim)]
for x in range(dim):
  for y in range(dim):
    keypad[y][x] = 1+x+(dim*y)

x = 1
y = 1
for l in lines:
  for c in l:
    if c == 'U':
      y = max(0,y-1)
    elif c == 'D':
      y = min(dim-1,y+1)
    elif c == 'L':
      x = max(0,x-1)
    elif c == 'R':
      x = min(dim-1,x+1)
  print(keypad[y][x],end="")
print()
